INSERT INTO `SitePage` (`id`, `site_id`, `url`, `html`, `title`, `showInfoBlock`) VALUES
(1, 1, 'index.html', '<h1><em><font color="red"><span style="background-color: yellow;"><strong>Thank you to all who entered - I hope you had a great weekend!</strong></span></font></em></h1>\r\n\r\n<p><a href="#FrenchDeets"><img alt="" src="http://www.isbtplanner.com/files/1/16-penpicture.jpg" style="width: 200px; height: 150px; float: left;" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;<a href="#FrenchDeets">​<img alt="" src="http://www.isbtplanner.com/files/1/12-frenchflag.jpg" style="width: 16px; height: 12px;" />&nbsp;Pour le francais, voir ci-dessous anglais</a></p>\r\n\r\n<div><span style="line-height: 1.6em;">&nbsp;&nbsp;</span><a href="#SpanishDeets" style="line-height: 1.6em;"><img alt="" src="http://www.isbtplanner.com/files/1/13-cheapcallingtospainflag.jpg" style="width: 16px; height: 12px;" />&nbsp;Para espa&ntilde;ol ver m&aacute;s abajo</a></div>\r\n\r\n<p>&nbsp;&nbsp;<a href="#GermanDeets"><img alt="" src="http://www.isbtplanner.com/files/1/14-germanyflag.jpg" style="width: 16px; height: 12px;" />&nbsp;F&uuml;r deutch - bitte schauen sie unten</a></p>\r\n\r\n<p>&nbsp;&nbsp;<a href="#Chinese"><img alt="" src="http://www.isbtplanner.com/files/1/15-chinaflag.gif" style="width: 16px; height: 12px;" />&nbsp;<span style="color: rgb(31, 73, 125); line-height: normal; font-family: SimSun; font-size: 15px;">中文版：点这里</span></a></p>\r\n\r\n<p><span style="line-height: 1.6em;">The London ISBT committee is delighted to announce the 1st International SoliBad Badminton Tournament to be held in London (details about the SoliBad charity below). The tournament will take place at Sobell Leisure Centre (N7 7NY), London on the weekend of </span><span style="line-height: 1.6em; background-color: yellow;"><b>28th-30th June 20xx</b></span><span style="line-height: 1.6em;"> and has been <u>sanctioned by Badminton England</u>. &nbsp;This first year the tournament consists of 2 full days of badminton, and three evenings of entertainment!</span></p>\r\n\r\n<p>The tournament is a charity event organized as a part of the official SoliBad day 20xx and is based on the very successful International Student Badminton Tournament format. A Swiss Ladder tournament system will be operated catering for all levels of play (18+ adult&#39;s only) from complete beginner to advanced player, with equal amounts of badminton for all involved. There will be 4 grades and partners will be drawn at random. Singles, doubles and mixed competitions will be played (2 disciplines per participant) with all individuals&rsquo; scores contributing to their overall team score.<br />\r\n<br />\r\nTournament discipline descriptions and tournament shuttles (not supplied):<br />\r\nA. <b>Elite players</b> &ndash; e.g. represented your country, your province, your county team - Feather<br />\r\nB. <b>Advanced</b>&nbsp;&ndash; e.g. below county level, plays competitively for your club - Feather<br />\r\nC. <b>Intermediate</b> &ndash; e.g. played badminton for a number of years and regularly - Feather<br />\r\nD. <b>Beginner</b> &ndash; e.g. first time playing, or less than 3 years socially &ndash; Plastic or Feather if preferred<br />\r\n<br />\r\nTeams can enter from 1 to 25 (max) people. If a team wishes to enter more players than this &ndash; they must contact the committee directly. Overall team scores at the end are averaged by the number of participants (minimum of 5 on a team to be eligible for the team prize) to determine the winning team. <b>Registration is on Friday 28th from 7pm&nbsp;in &quot;<a href="http://www.jdwetherspoon.co.uk/home/pubs/the-coronet">The Coronet</a>&quot;, 338 Holloway Road&nbsp;and play will begin at 9am Saturday 29 th June 20xx</b> and continue on Sunday. After play on both days there will be dinner, entertainment and on Sunday, prize-givings. Breakfast and lunch on both days will be provided also.</p>\r\n\r\n<ul>\r\n  <li><span style="background-color: yellow;"><b>Fee: &pound;50 or &euro;55 per person </b></span></li>\r\n <li>Closing date is Friday 31st May 20xx - or earlier, if deposits are received for the maximum capacity of entrants</li>\r\n <li>Deposits of &pound;20 or &euro;25 per player is essential to guarantee entry places. &nbsp;Remainder to be paid at registration</li>\r\n</ul>\r\n\r\n<table border="1">\r\n <tbody>\r\n   <tr>\r\n      <td><b>Entry fee includes:</b></td>\r\n     <td><b>Entry fee excludes:</b></td>\r\n   </tr>\r\n   <tr>\r\n      <td>&bull; 2 days badminton<br />\r\n     &bull; 2 breakfasts<br />\r\n     &bull; 2 lunches<br />\r\n      &bull; 2 dinners<br />\r\n      &bull; 3 planned parties</td>\r\n     <td>&bull; Shuttles<br />\r\n     &bull; Transport<br />\r\n      &bull; Accommodation<br />\r\n      &bull; Parking<br />\r\n      &bull; Tournament T-shirt</td>\r\n    </tr>\r\n </tbody>\r\n</table>\r\n\r\n<p><strong>Tournament t-shirts will be available for sale from the registration evening, in all the colours of the SoliBad logo</strong></p>\r\n\r\n<p><strong>To enter:&nbsp;</strong></p>\r\n\r\n<p style="color: rgb(34, 34, 34); line-height: normal; font-family: arial, sans-serif;"><span lang="EN-GB">1.<span style="font-family: &quot;Times New Roman&quot;; font-size: 7pt;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span lang="EN-GB">Create a new team, if your team is not already in the&nbsp;<a href="http://www.isbtplanner.com/london20xx/team.html">list of teams</a></span></p>\r\n\r\n<p style="color: rgb(34, 34, 34); line-height: normal; font-family: arial, sans-serif;"><span lang="EN-GB">2.<span style="font-family: &quot;Times New Roman&quot;; font-size: 7pt;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span lang="EN-GB">Register yourself as a new player on the&nbsp;<a href="http://www.isbtplanner.com/london20xx/player.html">players page</a></span></p>\r\n\r\n<p style="color: rgb(34, 34, 34); line-height: normal; font-family: arial, sans-serif;"><span lang="EN-GB">3.<span style="font-family: &quot;Times New Roman&quot;; font-size: 7pt;">&nbsp; &nbsp; &nbsp; &nbsp;</span></span><span lang="EN-GB">Go to the&nbsp;<a href="http://www.isbtplanner.com/london20xx/payment/info.html">payments page</a>&nbsp;to see methods of payment - paypal or bank transfer</span></p>\r\n\r\n<p><br />\r\nThis tournament is not for profit and any budget excess will be donated to the SoliBad charity</p>\r\n\r\n<p><br />\r\n<b>SoliBad charity</b><br />\r\nFor information about the SoliBad charity please refer to its website <a href="http://www.SoliBad.net/">www.SoliBad.net</a><br />\r\n<br />\r\n<b>Travel details:</b><br />\r\nGetting to London &ndash; You have many choices fly to; Heathrow, Gatwick, Stansted, Luton, Southend or City airports are all London&rsquo;s airports. From each, there is public transport to get into the city centre, and from there the Tube can take you where you need to go.<br />\r\nTip &ndash; use www.tfl.gov.uk to plan your journey around London and use an Oyster card for cheaper fares on public transport.</p>\r\n\r\n<p>Getting from tube to Sobell Leisure Centre is really easy to get to from Holloway Road tube station or from Finsbury Park tube station &ndash; just 10 mins walk from either. Holloway Road is on the Piccadilly line only, and Finsbury Park is on both the Piccadilly and Victoria tube lines.<br />\r\nTube tip &ndash; Do not get off the Tube at Arsenal &ndash; it&rsquo;s literally on the wrong side of the tracks even though it looks close by. To get to Sobell from there, you&rsquo;ll pretty much have to walk back to one of the other stations!<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Accommodation:</strong></p>\r\n\r\n<p>There isn&#39;t much by way of decent budget hotels within very close proximity to Sobell, but London&#39;s famous Underground means getting to and fro is relatively easy. The majority of the suggestions below are centred near King&#39;s Cross station as this is well under 30 mins from the hall by public transport and well connected for those travelling to and from the city for the weekend. Also, it makes getting home from nights out easier&nbsp;and cheaper for people if most are going in the same general direction! All accommodation in London will fill up quickly at this time of year so please book early if you want your team to be together and within a reasonable distance to Sobell.</p>\r\n\r\n<ul>\r\n  <li><a href="http://www.hostelworld.com/hosteldetails.php/Arsenal-Tavern-Hostel/London/49791?dateFrom=28+Jun+20xx&amp;dateTo=01+Jul+20xx#availability">Arsenal Tavern Hostel</a> - Closest Cheap accommodation you&#39;re likely to find, but don&#39;t expect luxury!</li>\r\n <li><a href="http://www.clinkhostels.com/">Clink Hostels, Kings Cross</a> -&nbsp;These are 2 sister hostels within walking distance of King&#39;s Cross. Clink 261 is described as &quot;boutique&quot; and is closer to the station, whereas Clink 78 appears to be more of a party-friendly hostel.</li>\r\n  <li><a href="http://www.travelodge.co.uk/hotels/258/London-Central-Kings-Cross-hotel">Travelodge, Kings Cross</a> - Cheapest of the hotels on the list if you&#39;re willing to sleep 3 to a room.</li>\r\n <li><a href="http://www.premierinn.com/en/hotel/KINPTI/london-kings-cross">Premier Inn, Kings Cross</a> -&nbsp;Premier Inn Islington as an alternative is slightly cheaper but also slightly further from the sports hall.</li>\r\n <li><a href="http://www.comfortinnkingscross.co.uk/">Comfort Inn Kings Cross</a></li>\r\n <li><a href="http://www.ihg.com/holidayinn/hotels/gb/en/london/lonkc/hoteldetail">Holiday Inn Kings Cross</a>&nbsp;-&nbsp;Discount on bookings fully paid 21 days in advance of check-in.</li>\r\n  <li><a href="http://www.crestfieldhotel.co.uk/">Crestfield Hotel Kings Cross</a> -&nbsp;No lifts so be sure to say you have heavy bags with sports gear &amp; equipment and want a lower floor room if possible. (Also the lower rooms are bigger) Very limited spaces here, but had to be included as it has a 24 hour bar!</li>\r\n <li><a href="https://www.airbnb.co.uk/">Apartment Rentals</a> if you prefer</li>\r\n  <li><a href="http://www.booking.com/">Generic Booking.com</a>&nbsp;search around the N7 7NY location, for proximity to the tournament</li>\r\n</ul>\r\n\r\n<p><br />\r\n<b>Theme:</b><br />\r\nThe theme of this year&rsquo;s tournament is the &quot;London Underground&quot;. &nbsp;We picked this for a number of reasons:</p>\r\n\r\n<ul>\r\n <li>its colourful tube lines are a similar scheme to the SoliBad logo</li>\r\n  <li>it&#39;s an icon of London &amp; is 150 years old this year</li>\r\n  <li>there are&nbsp;a massive number of fancy dress possibilities with all the tube station names&nbsp;(for some ideas look <a href="http://www.lookforlonger.com/">here</a>)</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We look forward to seeing representatives from your Club/University/Country at what will be a highly enjoyable tournament for all involved. If you have any questions please contact the committee at ISBTLondon@gmail.com or post on <a href="https://www.facebook.com/events/132838030230096">our&nbsp;facebook page</a></p>\r\n\r\n<p>​<span style="line-height: 1.6em;">​</span></p>', 'General', 1),
(2, 2, 'index.html', '<p>Test info</p>', 'Test info', 1),
(3, 3, 'index.html', '<p><big>ISBT Limerick info</big></p><p>More info will follow soon.</p>', 'General', 1),
(4, 4, 'index.html', '<h2 style="font-style: italic;">Hello Finsbury!</h2><p>This year, we are going high-tech and running the tourney online!</p><h2 style="font-style: italic;">To enter:</h2><h2 style="font-style: italic;">--&gt; Log in and&nbsp;create&nbsp;yourself a profile, using the &#39;Log in&#39; link in the top right</h2><h2 style="font-style: italic;">--&gt; Then Register&nbsp;yourself as a player using the green button</h2><h3 style="font-style: italic;"><big>&nbsp; &nbsp; &nbsp;--&gt; Choose Finsberries A! or Finsberries B!&nbsp;as your group</big></h3><h3 style="font-style: italic;"><big>&nbsp; &nbsp; &nbsp;--&gt; Enter A, in both doubles and mixed</big></h3><h3 style="font-style: italic;"><big>Leave the rest to us (Conor &amp; Laura)</big></h3><p>&nbsp;</p>', 'General', 1),
(5, 5, 'index.html', '<p>More info will follow soon</p>', 'General', 1),
(6, 6, 'index.html', '<p>The Enschede ISBT is known for it&#39;s great facilities, parties, badminton and the large amount of participants. We all await lots of subscriptions and love to see you all the 28th of December for this great event!<br />\r\n<br />\r\nThe committee is working hard to fit all the pieces together, to have the best ISBT since, well since the last one. Hope to see you in Enschede to celebrate the end of a great 20xx.</p>\r\n\r\n<p><br />\r\nTo learn more about the tournament, click the &#39;about&#39;-button!</p>', 'General', 1),
(8, 6, 'committee', '<h1><strong>Committee</strong></h1>\r\n\r\n<p>More information and photo&#39;s will be available soon.</p>', 'Committee', 1),
(9, 6, 'program', '<h1><strong>Program</strong></h1>\r\n\r\n<h3>(a.k.a.: what are we going to do)</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Saturday, December 28th:</strong></p>\r\n\r\n<ul>\r\n <li>Arrival and registration (don&#39;t forget to bring your 50 &euro; <u>CASH</u>!)</li>\r\n <li>Getting used to the dutch beer</li>\r\n</ul>\r\n\r\n<p><strong>Sunday, December 29th:</strong></p>\r\n\r\n<ul>\r\n  <li>Match day nr. 1</li>\r\n  <li>Dinner</li>\r\n <li>PARTY!</li>\r\n</ul>\r\n\r\n<p><strong>Monday, December 30th:</strong></p>\r\n\r\n<ul>\r\n  <li>Match day nr. 2</li>\r\n  <li>More dinner</li>\r\n  <li>More party</li>\r\n</ul>\r\n\r\n<p><strong>Tuesday, December 31st:</strong></p>\r\n\r\n<ul>\r\n <li>Match day nr. 3</li>\r\n  <li>Award ceremony</li>\r\n <li>Even more dinner</li>\r\n <li>New Year&#39;s Eve party</li>\r\n</ul>\r\n\r\n<p><strong>Wednesday, January 1st (2014!!!):</strong></p>\r\n\r\n<ul>\r\n <li>Departure of participants (aww, y u leave so soon? :( )</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Program', 1),
(16, 6, 'cost', '<p>Cost</p>', 'Cost', 1);
